import "./Code.css";

const Code = () => {
    return (
        <div class = "code">
            <div class = "title">
                projects
            </div>  
            <div class = "description">
                through personal projects, not only do i aim to grow in my technical skills, but i also aim to make real societal impact. some initiatives include a music therapy app to help students with autism destress within a classroom environment,                 
            </div>
        </div>
    );
};

export default Code;
